import React, { useEffect, useState} from 'react';
import {Link, useParams} from "react-router-dom";
import {GetPrizivnik} from "../context/provider";


function FullPriziv() {

    const params = useParams();
    const pk = params.id
    const fullpriziv = GetPrizivnik(pk)


    return (
        <div>
                <div key={fullpriziv.id}>
                    <ul>
                        <Link to="/priziv">Призывники</Link> / <Link to={`/${fullpriziv.surname}`}>{fullpriziv.surname}</Link>
                        <br/>
                        <img src={require('../fotki/1.png')} width="240" height="255"/>
                        <div className={"name"}><a>Фамилия:</a> {fullpriziv.surname}</div>
                        <div className={"name"}><a>Имя:</a> {fullpriziv.name}</div>
                        <div className={"name"}><a>Отчество:</a> {fullpriziv.patronymic}</div>
                        <div className={"name"}><a>Категория:</a> {fullpriziv.categoriya}</div>
                        <div className={"name"}><a>Возраст:</a> {fullpriziv.vozrast}</div>
                        <div className={"name"}><a>Наличие отсрочки:</a> {fullpriziv.otsrochka}</div>
                        <div className={"name"}><a>Адрес:</a> {fullpriziv.adress}</div>
                    </ul>
                </div>
            </div>

    );
}

export default FullPriziv;
